In CKB we use RISC-V's standard syscall solution: each syscall accepts 6 arguments stored in register A0 through A5. Each argument here is of register word size so it can store either regular integers or pointers. The syscall number is stored in A7. After all the arguments and syscall number are set, ecall instruction is used to trigger syscall execution, CKB VM then transfers controls from the VM to the actual syscall implementation beneath. For example, the following RISC-V assembly would trigger Exit syscall with a return code of 10: li a0, 10
li a7, 93
ecall As shown in the example, not all syscalls use all the 6 arguments. In this case the caller side can only fill in the needed arguments. Syscalls can respond to the VM in 2 ways: A return value is put in A0 if exists. Syscalls can also write data in memory location pointed by certain syscall arguments, so upon syscall completion, normal VM instructions can read the data prepared by the syscall. For convenience, we could wrap the logic of calling a syscall in a C function: static inline long
__internal_syscall(long n, long _a0, long _a1, long _a2, long _a3, long _a4, long _a5)
{ register long a0 asm("a0") = _a0; register long a1 asm("a1") = _a1; register long a2 asm("a2") = _a2; register long a3 asm("a3") = _a3; register long a4 asm("a4") = _a4; register long a5 asm("a5") = _a5; register long syscall_id asm("a7") = n; asm volatile ("scall" : "+r"(a0) : "r"(a1), "r"(a2), "r"(a3), "r"(a4), "r"(a5), "r"(syscall_id)); return a0;
} #define syscall(n, a, b, c, d, e, f) \ __internal_syscall(n, (long)(a), (long)(b), (long)(c), (long)(d), (long)(e), (long)(f)) (NOTE: this is adapted from riscv-newlib ) Now we can trigger the same Exit syscall more easily in C code: syscall(93, 10, 0, 0, 0, 0, 0); Note that even though Exit syscall only needs one argument, our C wrapper requires us to fill in all 6 arguments. We can initialize other unused arguments as all 0. Below we would illustrate each syscall with a C function signature to demonstrate each syscall's accepted arguments. Also for clarifying reason, all the code shown in this RFC is assumed to be written in pure C. Exit Load Transaction Hash Load Transaction Load Script Hash Load Script Load Cell Load Cell By Field Load Cell Data Load Cell Data As Code Load Input Load Input By Field Load Header Load Header By Field Load Witness Debug

