To ease PoW computation, the header is split into raw and nonce. struct Header { raw: RawHeader, nonce: Uint128,
} The header must meet the last inequality in the following snippet: pow_hash := ckbhash(molecule_serialize(raw))
pow_message := pow_hash || to_le(nounce)
pow_output := eaglesong(pow_message)
// for testnet, there is another round of hash
// pow_output = ckbhash(pow_output) from_be(pow_output) <= compact_to_target(raw.compact_target) ※ eaglesong in ckb v0.34.1 Functions used in the pseudocode: :=: assignment ||: binary concatenation. ckbhash: Blake2b hash with CKB specific configuration, see Appendix. to_le: Convert unsigned integer to bytes in little-endian. The bytes count is the same with the integer width. from_be: Convert bytes encoded in big-endian to an unsigned integer. molecule_serialize: Serialize a structure into binary using its schema. eaglesong: See RFC Eaglesong (Proof-of-Work Function for Nervos CKB) . compact_to_target: raw.compact_target encodes the difficulty target in a compact form. This function restores the target from the compact form. The block is referenced by the header hash, for example, in raw.parent_hash. header_hash := ckb_hash(molecule_serialize(header)) ※ HeaderReader::calc_header_hash in util/types/src/extension/calc_hash.rs Notice that Header and RawHeader are all fixed-size structures. The serialization of them is just the simple binary concatenation of the fields in order.

