Assume CKB has the following method for reading cell data: int ckb_read_cell_data(size_t index, size_t source, void** buffer, size_t* size); Given a cell ID, CKB VM will mmap cell content to address space of current virtual machine, and returns pointer to the content and size. Following contract can then be used for issuing tokens: int udt_initialize(data_t *data, char owner[ADDRESS_LENGTH], int64_t total_supply)
{ memset(&data, 0, sizeof(data_t)); memcpy(data->owner, owner, ADDRESS_LENGTH); memcpy(data->balances[0].address, owner, ADDRESS_LENGTH); data->balances[0].tokens = total_supply; data->used_balance = 1; data->used_allowed = 0; data->total_supply = total_supply; return 0;
} int main(int argc, char* argv[]) { data_t data; ret = udt_initialize(&data, "<i am an owner>", 10000000); if (ret != 0) { return ret; } data_t *output_data = NULL; ret = ckb_read_cell(0, CKB_SOURCE_OUTPUT, (void **) &output_data, NULL); if (ret != 0) { return ret; } if (memcmp(&data, output_data, sizeof(data_t)) != 0) { return -1; } return 0;
} It ensures generated data is legit by validating that contents in output cell match contents generated in token initializing steps.

