In the above example, function implementation for validating cell is directly compiled into input contract script. It's also possible to reference and call code from external cell for validation. First, the following implementation can be provided for transfering UDT tokens: int udt_transfer(data_t *data, const char from[ADDRESS_LENGTH], const char to[ADDRESS_LENGTH], int64_t tokens)
{ balance_t *from_balance = NULL, *to_balance = NULL; int ret = _udt_find_balance(data, from, 1, &from_balance); if (ret != 0) { return ret; } ret = _udt_find_balance(data, to, 1, &to_balance); if (ret != 0) { return ret; } if (from_balance->tokens < tokens) { return ERROR_NOT_SUFFICIENT_BALANCE; } int target = to_balance->tokens + tokens; if (target < to_balance->tokens) { return ERROR_OVERFLOW; } from_balance->tokens -= tokens; to_balance->tokens = target; return 0;
} _udt_find_balance here is used to locate balance_t data structure given an address, and also create an entry if the address doesn't already exist. Here we omit the full implementation for this function, please refer to CKB codebase for full example. Following binary code is compiled result of this function: 00000000 <_udt_find_balance>: 0: 7179 addi sp,sp,-48 2: d606 sw ra,44(sp) 4: d422 sw s0,40(sp) 6: 1800 addi s0,sp,48 8: fca42e23 sw a0,-36(s0) c: fcb42c23 sw a1,-40(s0) 10: fcc42a23 sw a2,-44(s0) 14: fcd42823 sw a3,-48(s0) 18: fe042623 sw zero,-20(s0) 1c: 57fd li a5,-1 1e: fef42423 sw a5,-24(s0) 22: a835 j 5e <.L2> 00000024 <.L5>: 24: fec42703 lw a4,-20(s0) 28: 87ba mv a5,a4 2a: 078a slli a5,a5,0x2 2c: 97ba add a5,a5,a4 2e: 078e slli a5,a5,0x3 30: fdc42703 lw a4,-36(s0) 34: 97ba add a5,a5,a4 36: 02000613 li a2,32 <omitted ...> Tools will be provided by CKB to encode the binary code here as cell data. Following input contract script can then be used: typedef int *transfer(data_t *, const char*, const char*, int64_t); int main(int argc, char* argv[]) { data_t *input_data = NULL; ret = ckb_read_cell(0, CKB_SOURCE_INPUT, (void **) &input_data, NULL); if (ret != 0) { return ret; } data_t *output_data = NULL; ret = ckb_read_cell(1, CKB_SOURCE_OUTPUT, (void **) &output_data, NULL); if (ret != 0) { return ret; } transfer *f = (transfer *) ckb_mmap_cell(function_cell_id, 0, -1, PROT_EXEC); ret = f(input_data, from, to, 100); if (ret != 0) { return ret; } if (memcmp(input_data, output_data, sizeof(data_t)) != 0) { return -1; } return 0;
} With mmap, we load a cell directly as a callable function, this function is then used to complete the transfer. This way we can ensure contract size stays minimal while reusing the same method across multiple transactions.

