Even though transfer method is stored as an external cell in the above example, one disadvantage here is that the memory address of the mmapped function is unknown at compile time. As a result, internal implementation within that method can only leverage local jumps. In addition, only one function is supported this way, there's no way to store multiple function in a single cell. Dynamic linking is provide to solve this problem: assuming we have all UDT functions compiled as a shared library in one cell: int udt_initialize(data_t *data, char owner[ADDRESS_LENGTH], int64_t total_supply);
int udt_total_supply(const data_t *data);
int64_t udt_balance_of(data_t *data, const char address[ADDRESS_LENGTH]);
int udt_transfer(data_t *data, const char from[ADDRESS_LENGTH], const char to[ADDRESS_LENGTH], int64_t tokens);
int udt_approve(data_t *data, const char from[ADDRESS_LENGTH], const char spender[ADDRESS_LENGTH], int64_t tokens);
int udt_transfer_from(data_t *data, const char from[ADDRESS_LENGTH], const char spender[ADDRESS_LENGTH], const char to[ADDRESS_LENGTH], int64_t tokens); With dynamic linking, following input script can be used: int main(int argc, char* argv[])
{ data_t *input_data = NULL; ret = ckb_read_cell(0, CKB_SOURCE_INPUT, (void **) &input_data, NULL); if (ret != 0) { return ret; } data_t *output_data = NULL; ret = ckb_read_cell(0, CKB_SOURCE_OUTPUT, (void **) &output_data, NULL); if (ret != 0) { return ret; } if (strcmp(argv[4], "initialize") == 0) { // processing initialize arguments ret = udt_initialize(...); if (ret != 0) { return ret; } } else if (strcmp(argv[4], "transfer") == 0) { // processing transfer arguments ret = udt_transfer(input_data, ...); if (ret != 0) { return ret; } } else if (strcmp(argv[4], "approve") == 0) { // processing approve arguments ret = udt_approve(input_data, ...); if (ret != 0) { return ret; } } // more commands here if (memcmp(input_data, output_data, sizeof(data_t)) != 0) { return -1; } return 0;
} Here all UDT functions are linked dynamically from external cells, current contract can be minimized in terms of size.
